import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';

class Main extends Component {
  render() {
    return (
      <div className="Main">
        <div className="Header">Header</div>
        <div className="NavBar">Navabar </div>
        <div className="LitleMain">
          <div className="Logo">Logo</div>  
          <div className="SignPanel">Sign</div>
        </div>
      </div>
    );
  }
}
class LastMinute extends Component {
  render(){
    return(
      <div className="LastMinute">
        <h1>LastMinute</h1>
        <div className="LastTrips">
          Wycieczki
        </div>
      </div>


    );
  }
}

class Trip extends Component{
  render(){
    return(
      <div className="Trip">
        <div className="Info">
          <ul>
            <li>01.07 - 20.07.2019</li>
            <li>6789 PLN</li>
          </ul>
          <div className="Level">B</div>
        </div>
        <div className="Desc">
          <div className="TripName">Syberia</div>
          <div className="Type">Trek</div>
          <p>Tu bƒôdzie opis trasy</p>
          <div className="SeeMore">Wiƒôcej</div>

        </div>


      </div>
    );
  }
}



class App extends Component{
  render(){
    return (
      <div className="App">
        <Main/>
        <LastMinute />
      </div>
    );
  }
}


export default App;
